    const { currentUser } = useContext(AuthContext);

    if (!currentUser) {
        return <Redirect to="/login" />;
    }
    return (

      <div className="App">
          <Test />
          <div className="content">            
              <img src="./LOGO.png" alt="LOGO" className="photo55" />
              <h1>
                  Welcome To GazeGuard</h1>     

        </div>
            <Social />
      </div>

    )
}
export default DashBoard;
